 import React from 'react';
 import props from 'prop-types'
 import GoodDayMessage from './components/GoodDayMessage'
 import { Box, Card, Image, Heading, Text, Flex} from 'rebass'
 import grid from '@styled-system/grid'
 import './App.css';
 import RebassTheme from './components/RebassTheme'
 import ProjectCards from './components/RebassCard.js'
 import { NavLink, Switch, Route } from 'react-router-dom'
 import HomeButton from './components/HomeButton.js'


const App = () => (
  <div className='App'>
    <Main />
  </div>
);

const Home = () => (
  <div className='Home'>
    <Box>
      <Card as='h1' mx='auto'>Brett Schlereth</Card>
    </Box>
    <ProjectCards display='block' margin='auto' width='100%'/>
  </div>
)

const contentStyle = {
  marginLeft: '10%'
}

const headerStyle = {
  marginLeft: '300px'
}

const BunkerDown = () => (
  <div className='BunkerDown'>
    <div width='100%' display='table'>
      <HomeButton/>
      <div display="flex">Bunker Down</div>
    </div>
    <div style={contentStyle}>
    Somebody once told me the world is gonna roll me
I ain't the sharpest tool in the shed
She was looking kind of dumb with her finger and her thumb
In the shape of an "L" on her forehead
Well the years start coming and they don't stop coming
Fed to the rules and I hit the ground running
Didn't make sense not to live for fun
Your brain gets smart but your head gets dumb
    </div>
  </div>
);

const DInfinity = () => (
  <div className='DInfinity'>
  <h1>DInfinity</h1>
    <HomeButton/>
  </div>
)

const Resume = () => (
  <div className='Resume'>
    <HomeButton/>
    Resume Page
  </div>
)

const BlackjackAI = () => (
  <div className='BlackjackAI'>
    <HomeButton/>
    BlackjackAI Page
  </div>

)

const Main = () => (
  <Switch>
    <Route exact path='/' component={Home}></Route>
    <Route exact path='/BunkerDown' component={BunkerDown}></Route>
    <Route exact path='/DInfinity' component={DInfinity}></Route>
    <Route exact path='/Resume' component={Resume}></Route>
  </Switch>
);

export default App;
